import React, { useState } from 'react';
import {
  Container,
  Typography,
  TextField,
  Box,
  Switch,
  FormControlLabel,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  CircularProgress,
  Alert,
  Tabs,
  Tab,
} from '@mui/material';
import axios from '../utils/axios';

const SearchResultCard = ({ result, isExternal }) => {
  return (
    <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
      <CardContent sx={{ flexGrow: 1 }}>
        <Typography gutterBottom variant="h6" component="h2">
          {result.title}
        </Typography>
        {!isExternal && (
          <Typography color="text.secondary" gutterBottom>
            {result.category}
          </Typography>
        )}
        <Typography variant="body2" color="text.secondary">
          {result.description}
        </Typography>
      </CardContent>
      <CardActions>
        <Button
          size="small"
          color="primary"
          onClick={() => window.open(result.url, '_blank')}
        >
          Visit Resource
        </Button>
      </CardActions>
    </Card>
  );
};

const Search = () => {
  const [query, setQuery] = useState('');
  const [isExternalSearch, setIsExternalSearch] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [results, setResults] = useState({
    local: [],
    external: []
  });
  const [tabValue, setTabValue] = useState(0);

  const handleSearch = async () => {
    if (!query.trim()) return;

    setLoading(true);
    setError(null);

    try {
      if (isExternalSearch) {
        // Search external APIs
        const [githubRes, arxivRes] = await Promise.all([
          axios.get(`/api/search/github?q=${encodeURIComponent(query)}`),
          axios.get(`/api/search/arxiv?q=${encodeURIComponent(query)}`)
        ]);

        setResults({
          local: [],
          external: [...githubRes.data.items, ...arxivRes.data.items]
        });
      } else {
        // Search local database
        const response = await axios.get(`/api/search?q=${encodeURIComponent(query)}`);
        setResults({
          local: response.data.resources,
          external: []
        });
      }
    } catch (err) {
      console.error('Search error:', err);
      setError('Failed to perform search');
    } finally {
      setLoading(false);
    }
  };

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Search AI Resources
      </Typography>

      <Box sx={{ mb: 4 }}>
        <TextField
          fullWidth
          variant="outlined"
          placeholder="Search for AI resources..."
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          onKeyPress={(e) => e.key === 'Enter' && handleSearch()}
          sx={{ mb: 2 }}
        />
        <FormControlLabel
          control={
            <Switch
              checked={isExternalSearch}
              onChange={(e) => setIsExternalSearch(e.target.checked)}
            />
          }
          label="Search external sources (GitHub & arXiv)"
        />
        <Button
          variant="contained"
          onClick={handleSearch}
          disabled={loading || !query.trim()}
          sx={{ ml: 2 }}
        >
          Search
        </Button>
      </Box>

      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center', my: 4 }}>
          <CircularProgress />
        </Box>
      ) : error ? (
        <Alert severity="error" sx={{ my: 2 }}>
          {error}
        </Alert>
      ) : (
        <>
          <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 3 }}>
            <Tabs value={tabValue} onChange={handleTabChange}>
              <Tab label="Local Results" />
              <Tab label="External Results" />
            </Tabs>
          </Box>

          <Grid container spacing={3}>
            {(tabValue === 0 ? results.local : results.external).map((result) => (
              <Grid item xs={12} sm={6} md={4} key={result.id}>
                <SearchResultCard
                  result={result}
                  isExternal={tabValue === 1}
                />
              </Grid>
            ))}
          </Grid>

          {(tabValue === 0 ? results.local : results.external).length === 0 && (
            <Alert severity="info" sx={{ my: 2 }}>
              No results found. Try different search terms.
            </Alert>
          )}
        </>
      )}
    </Container>
  );
};

export default Search;
